import React, { useEffect, useState } from 'react';
import axios from 'axios';
import image13 from '../images/image14.jpg';

const Products = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchQuery, setSearchQuery] = useState('');

  const fetchProducts = async (query = '') => {
    setLoading(true);
    try {
      const response = await axios.get('http://localhost:3000/api/product/get_all_products', {
        params: { search: query },
      });
      setProducts(response.data.products);
      setLoading(false);
    } catch (err) {
      setError(err.message);
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchProducts();
  }, []);

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleSearchSubmit = (e) => {
    e.preventDefault();
    fetchProducts(searchQuery);
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  const columnSize = products.length > 4 ? 'col-6 col-md-4 col-lg-3' : `col-${12 / products.length}`;

  return (
    <div className="container-fluid card-container">
      <div className="carousel-caption d-none d-md-block" style={{ zIndex: '10' }}>
        <form className="d-flex" onSubmit={handleSearchSubmit}>
          <input
            className="form-control mr-sm-2"
            type="search"
            placeholder="Search"
            aria-label="Search"
            value={searchQuery}
            onChange={handleSearchChange}
          />
          <button className="btn btn-outline-success my-2 my-sm-0 text-white bg-success" type="submit">
            Search
          </button>
        </form>
      </div>
      <div className="row">
        {products.map((product) => (
          <div key={product._id} className={columnSize + ' mb-4'}>
            <div className="card card-custom bg-dark" style={{ maxHeight: '150px' }}>
              <div className="fs-3 m-3 text-white p-2 rounded">{product.productCategory}</div>
              <img src={image13} className="card-img-top img-fluid" />
              <div className="card-body">
                <h5 className="card-title text-white">{product.productName}</h5>
                <p className="card-title text-white">{product.productDescription}</p>
                <p className="card-text">
                  <div className="container w-100">
                    <select className="m-2 h-100 bg-success rounded">
                      {Array.from(Array(5), (e, i) => (
                        <option key={i + 1} value={i + 1}>
                          {i + 1}
                        </option>
                      ))}
                    </select>
                    <select className="m-2 h-100 bg-success rounded">
                      <option value="half">Half</option>
                      <option value="full">Full</option>
                    </select>
                    <hr style={{ borderTop: '1px solid white' }}></hr>
                    <div className="h5 d-inline text-light">Total Price: {product.productPrice}</div>
                  </div>
                  <hr style={{ borderTop: '1px solid white' }}></hr>
                  <button className="btn btn-success justify-center ms-2">Add to Cart</button>
                </p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Products;
